import React from 'react';

export function loadWarns(warns, user) {
    if (warns.length <= 0) {
        return (
            <span>No Warns</span>
        )
    } else {
        return (
            <ul>
                {
                    warns.map(warn => {
                        return (
                            <li>
                                <span>{user.username} has {warns.length} {warns.length > 1}</span>
                                <span>{warn.punishmentId}</span>
                                <span>{warn.reason}</span>
                            </li>
                        )
                    })
                }
            </ul>
        )
    }
}
